const Contact = () => {
    return (
      <section className="container">
        <h2>Contact Mario</h2>
        <p>For media inquiries, sponsorships, or general contact:</p>
        <ul>
          <li>Email: <a href="mailto:contact@mariostroeykens.com">contact@mariostroeykens.com</a></li>
          <li>Instagram: <a href="https://instagram.com/mariostroeykens" target="_blank" rel="noreferrer">@mariostroeykens</a></li>
        </ul>
      </section>
    );
  };
  
  export default Contact;
